import React from "react";
import { FullpageSection } from "@ap.cx/react-fullpage";
import poter from "../../img/poter1.png";

const HomeConts3 = () => {
  return (
    <FullpageSection>
      <div className="homeWrapper3">
        <div className="leftPro">
          <div className="project1 box">
            <ul>
              <li>
                <img src={poter}></img>
              </li>
              <li>
                <h1>Project1</h1>
              </li>
            </ul>
          </div>
          <div className="project2 box">pro2</div>
        </div>
        <div className="righttPro">
          <div className="project3 box">pro3</div>
          <div className="project4 box">pro4</div>
        </div>
      </div>
    </FullpageSection>
  );
};

export default HomeConts3;
